  "desc": "Успехи миссий марсоходов – вдохновляющее зрелище, бесспорно. Именно поэтому государства ООН профинансировали создание Департамента операций на Марсе и начали отправлять туда переселенцев. Первые из них прибыли на планету в 2037 году, а сейчас, спустя несколько десятилетий, к процессу колонизации в поисках выгоды подключились и частные компании. Вам предстоит возглавить космическую миссию одной из таких геологоразведочных компаний и создать самую продвинутую колонию на Марсе. Вам необходимо показывать хорошие результаты, выполняя задания Департамента – но главное выполнить тайные цели своей компании. Сперва вам придётся непросто, ведь ваша жизнь будет зависеть от поставок необходимых ресурсов с Земли, а за ними надо будет постоянно путешествовать на орбиту и обратно – но вы сможете строить шахты, электростанции, убежища и другие полезные здания и колония будет становиться более автономной. Главное – найти баланс между добычей того или иного необходимого ресурса. Красная планета ждёт ваших решений!'На Марсе' разработана геймдизайнером Виталом Ласердой, который знаменит своим умением создавать сложные и хорошо сочетающиеся игровые механики. Предыдущие игры Ласерды – это посвящённая виноделию элегантная Vinhos, погружающая в автопром Kanban: Driver's Edition и The Gallerist, знакомящая игроков с миром искусства и коллекционирования. 'На Марсе' была номинирована на премию The Laurels: Best Architect Games Of 2019 от The Cardboard Republic и уже заслужила горячую любовь и признание поклонников хардкорных стратегий. Это непростое испытание способности выбирать оптимальный вариант, в котором тактика тесно переплетена со стратегией. Широкий спектр возможностей хода позволяет гибко реагировать на изменение игровой ситуации – но главное понять, какая тактика приведёт вас к победе и титулу лучшего колониста. Такое обилие переменных делает игру очень вариативной – и, соответственно, реиграбельной. Каждая новая партия будет уникальной и заставит вас ломать голову снова и снова. Игра рассчитана на компанию до 4 человек включительно. Также есть соло-режим, в котором вам придётся играть против самого Ласерды – вы будете выполнять действия за него, ориентируясь на специальную колоду карт и правила одиночной игры. Выполняйте тайные и явные цели, стройте здания для добычи необходимых ресурсов и идите к победе!",
